import styled from 'styled-components';
import Footer from '../../footer/Footer';
import Body from './body/Body';
import Nav from '../../nav/Nav';

const StyledContainer = styled.div`
    filter:blur(2px);
`
const HomePage = () => {
    return (
        <StyledContainer>
            <Nav/>
            <Body/>
            <Footer/>
        </StyledContainer>
    )
}
export default HomePage;
